import './App.css';
import Tasks from './components/Tasks'

function App() {
  return (
    <div className="App">
        <header>
        <h1>TaskList</h1>
        <div className="input__task">
            <input type="text" placeholder="Add new task"></input>
            <button type="button">Add</button>
        </div>
        <Tasks/>
      </header>
    </div>
  );
}

export default App;
